import React from 'react';
import { Container, LogoImg, Title } from './styles';

import LogoFlip from '../../../../assets/logo_flip_cor.png';

export function SignUp() {
  return (
    <Container> 
      <LogoImg source={LogoFlip}/>
      <Title>Boas-vindas!</Title>
    </Container>
  );
}
